import { jsx as _jsx } from "react/jsx-runtime";
import { render } from '@testing-library/react';
import { ProductCardHeader } from './product-card-header';
describe('<ProductCardHeader>', () => {
    test('it should render properly', () => {
        const { container } = render(_jsx(ProductCardHeader, {}));
        expect(container).not.toBeNull();
    });
    test('it should render properly with props', () => {
        const { container } = render(_jsx(ProductCardHeader, { title: "title", subtitle: "subtitle", description: "description", titleRows: 2, descriptionRows: 2 }));
        expect(container).not.toBeNull();
    });
    test('it should render properly with skeleton', () => {
        const { container } = render(_jsx(ProductCardHeader, { title: "title", subtitle: "subtitle", description: "description", menuActions: _jsx("div", { children: "some content" }), isLoading: true }));
        expect(container).not.toBeNull();
    });
});
